webpackJsonp([90319027691713],{4169:function(a,t){a.exports={data:{markdownRemark:{html:'<p>掲示板のほうでも軽く触れていますが、やっとネット喫茶行く暇で来たのでこちらでも。 さて先日未明メインPCの故障につき、一部活動が一時停止ないし著しく遅くなります。なお現在修理中で復旧は4月中旬頃となります。これにより、復旧中の間に限りthG(仮称)の開発及び<a href="http://e.danmaq.com/">個人通販e-danmaq</a>の取扱いは一時中止となります。 この影響でthG(仮称)は「テスト以前版」から「テスト版(体験版以前版)」への格上げも1ヶ月近く遅れる見込み(5月～6月中旬辺り)です。 ご迷惑ご不便をおかけしますがご理解のほどお願いします。</p>',frontmatter:{cover:null,date:"2008-03-27T00:26:00+09:00",strDate:"2008/3/26",title:"danmaq活動の緊急一時停止告知"}}},pathContext:{path:"/ja/blog/2008/03/27-danmaq活動の緊急一時停止告知/",langKey:"ja"}}}});
